import { Link } from "react-router-dom"

import "./Navbar.css";

const Navbar = () => {
    return <div>
        <nav className={sty}>
            <Link to="/career">Career</Link>
            <Link to="/education">Education</Link>
            <Link to="/skills">Skills</Link>
        </nav>
    </div>
}

export default Navbar;
